import React from 'react';
import { View, FlatList, Button } from 'react-native';
import { createStackNavigator } from '@react-navigation/stack/native'; // Change import

const Stack = createStackNavigator(); // Use createStackNavigator from @react-navigation/stack/native

const exercises = [
  { id: 1, title: 'Duration Exercise' },
  { id: 2, title: 'Repetition Exercise' },
];

const Home = ({ navigation }) => {
  return (
    <View>
      <FlatList
        data={exercises}
        keyExtractor={(item) => item.id.toString()}
        renderItem={({ item }) => (
          <Button
            title={item.title}
            onPress={() => navigation.navigate(item.title)}
          />
        )}
      />
    </View>
  );
};

export default Home;
